import Layout from "../../components/Layout"
import { useRouter } from 'next/router'

const Post = () => {
    const router = useRouter();
    return (
        <Layout>
            <h1>Hi, dynamic part of this link is {router.query.postName}</h1>
        </Layout>
    );
}
export default Post;
